export default function False(){
		  return (
			<div>
				<Navbar/>
				<br/>
				<div className='container'>
						<div >
							<h1 className='m-2'>False Position Method</h1><br/>
							<Formflase />
						</div>
				</div>
			</div>
		  );
		};
